import React from "react";
import "./Card.css";
import { languages } from "../../helpers/data";
const Card = () => {
  return (
    <div className="cards-area-container">
      <div></div>
      <h5 className="language-title">Languages</h5>
      {languages.map((item, index) => {
        return (
          <div>

            <img src={item.img} alt="" />
            <h3> {item.name} </h3>
          </div>
        );
      })}
    </div>
  );
};

export default Card;
